import React from "react";
import { Button, Icon, Modal } from "semantic-ui-react";
import axios from "axios";

const CustomerDelete = (props) => {
  const { open, customerId, toggleAddModal, fetchCustomer } = props;

  const deleteCustomer = (id) => {
    axios
      .delete(`/Customers/DeleteCustomer/${id}`)
      .then((res) => {
        console.log(res.data);
        fetchCustomer();
      })
      .catch((err) => {
        console.log(err);
      });
  };

  return (
    <Modal open={open}>
      <Modal.Header>Delete Customer</Modal.Header>
      <Modal.Content></Modal.Content>
      <Modal.Actions>
        <Button color="black" onClick={() => toggleAddModal(false)}>
          Cancel
        </Button>
        <Button
          labelPosition="right"
          icon
          onClick={() => deleteCustomer(customerId)}
          positive
        >
          {" "}
          <Icon name="trash" />
          Delete
        </Button>
      </Modal.Actions>
    </Modal>
  );
};

export default CustomerDelete;
